import styled from "styled-components";

const CreateStyled = styled.div`
    padding-top:4rem;
    background-color:#144698;

    .button{
        margin:3.5rem;
        margin-top:2rem;
        padding:0rem 2rem 0rem 2rem;
    }

    .one{
        
    }

`;

const Create = () => (
    <CreateStyled>
        <div class="columns  is-mobile is-multiline is-centered">
            <div class="column is-half has-text-centered">
                <h2 class="title is-2 has-text-white has-text-weight-semibold  is-spaced">
                    Enter the Future of Finance
                </h2>
                <h3 class="subtitle is-3 has-text-grey-light">Empowering individual, investors, and developers to join the revolution</h3>
                <a class="button is-link is-large is-focused subtitle is-3 ">Create a Wallet</a>
                <a class="button is-link is-large is-focused subtitle is-3 one">Learn more</a>
            </div>
        </div>

    </CreateStyled>
);

export default Create;
